import React, { useState, useEffect } from 'react';
import './style.css';
function Home(){

      return (
        <Jumbotron>
          <h1>Olá!</h1>
          <p>
            Este é um exemplo do Componente Jumbotron construído com o
            React-Boostrap!
          </p>
          <p>
            <Button bsStyle="primary">Aprenda mais!</Button>
          </p>
        </Jumbotron>
      );
    };

    export default Home;
